INSERT INTO `ostau_content` (`id`, `content_id`, `isactive`, `type`, `name`, `body`, `lang`, `notes`, `created`, `updated`) VALUES
(1, 1, 1, 'landing', 'Home', '<h1>Bem-vindo ao Centro de Suporte</h1> A fim de agilizar as solicita&ccedil;&otilde;es de suporte e melhor atend&ecirc;-lo, n&oacute;s utilizamos um sistema de tickets. Cada pedido de suporte &eacute; atribu&iacute;do um n&uacute;mero de tickets &uacute;nico, que voc&ecirc; pode usar para monitorar o progresso e respostas online. Para sua refer&ecirc;ncia, n&oacute;s fornecemos arquivos completos e hist&oacute;rico de todos os seus pedidos de suporte.<br />', 'en_US', 'The Landing Page refers to the content of the Customer Portal''s initial view. The template modifies the content seen above the two links <strong>Open a New Ticket</strong> and <strong>Check Ticket Status</strong>.', '2016-04-28 17:55:58', '2016-04-29 08:30:00'),
(2, 2, 1, 'thank-you', 'Obrigado', '%{ticket.name}, <br /><br /> Obrigado por nos contatar.<br /><br /> Um pedido de ticket de suporte foi criado e um representante estar&aacute; respondendo&nbsp;de volta para voc&ecirc; em breve, se necess&aacute;rio. <br /><br /><br />Equipe de Suporte<br />', 'en_US', 'This template defines the content displayed on the Thank-You page after a Client submits a new ticket in the Client Portal.', '2016-04-28 17:55:58', '2016-04-29 08:56:09'),
(3, 3, 1, 'offline', 'Offline', '<div><h1><span style="font-size:medium">Sistema de Suporte Offline</span> </h1> Por favor desculpe, voltaremos assim que poss&iacute;vel.<br /> O nosso servi&ccedil;o de assist&ecirc;ncia est&aacute; offline no momento, por favor, volte mais tarde.<br /></div>', 'en_US', 'The Offline Page appears in the Customer Portal when the Help Desk is offline.', '2016-04-28 17:55:58', '2016-04-29 08:31:19'),
(4, 4, 1, 'registration-staff', 'Bem vindo ao Help Desk Intellissis', '<h3><strong>Ol&aacute; %{recipient.name.first},</strong></h3> <div> N&oacute;s criamos uma conta para voc&ecirc; em nosso help desk em %{url}.<br /><br /> Por favor, siga o link abaixo para confirmar sua conta e ter acesso aos seus tickets.<br /><br /><a href="%%7Blink%7D">%{link}</a><br /><br /><em>Seus amigos do suporte&nbsp;%{company.name}<br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="155" height="44" style="width:155px" /></a></em></div>', 'en_US', 'This template defines the initial email (optional) sent to Agents when an account is created on their behalf.', '2016-04-28 17:55:58', '2016-04-29 08:20:54'),
(5, 5, 1, 'pwreset-staff', 'Intellissis - Redefinir Senha', '<h3><strong>Ol&aacute; %{staff.name.first},</strong></h3> <div> Um pedido de redefini&ccedil;&atilde;o de senha foi enviada em seu nome para o help desk em %{url}.<br /><br /> Se voc&ecirc; acha que isso foi feito por engano, apague e desconsidere&nbsp;este e-mail. A sua conta esta segura e nenhum e os&nbsp;dados de&nbsp;acesso a ele. Sua conta e&nbsp;sua senha n&atilde;o foram&nbsp;alterados.&nbsp;Algu&eacute;m poderia ter entrado por engano o seu endere&ccedil;o de e-mail.<br /><br /> Siga o link abaixo para acessar o help desk e alterar sua senha.<br /><br /><a href="%%7Blink%7D">%{link}</a><br /><br /><em>-- Att.&nbsp;Suporte Intellissis</em>&nbsp;<br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" style="width:144px" width="144" height="41" /></a> </div>', 'en_US', 'This template defines the email sent to Staff who select the <strong>Forgot My Password</strong> link on the Staff Control Panel Log In page.', '2016-04-28 17:55:58', '2016-04-28 18:17:39'),
(6, 6, 1, 'banner-staff', 'Autenticação Requerida', '', 'en_US', 'This is the initial message and banner shown on the Staff Log In page. The first input field refers to the red-formatted text that appears at the top. The latter textarea is for the banner content which should serve as a disclaimer.', '2016-04-28 17:55:58', '2016-04-29 08:06:30'),
(7, 7, 1, 'registration-client', 'Bem vindo ao suporte %{company.name}', '<h3><strong>Ol&aacute; %{recipient.name.first},</strong></h3> <div> N&oacute;s criamos uma conta para voc&ecirc; em nosso help desk em %{url}.<br /><br /> Por favor, siga o link abaixo para confirmar sua conta e ter acesso aos seus tickets.<br /><br /><a href="%%7Blink%7D">%{link}</a><br /><br /><em>Seus amigos do suporte&nbsp;%{company.name}<br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="176" height="50" style="width:176px" /></a></em></div>', 'en_US', 'This template defines the email sent to Clients when their account has been created in the Client Portal or by an Agent on their behalf. This email serves as an email address verification. Please use %{link} somewhere in the body.', '2016-04-28 17:55:58', '2016-04-29 08:15:13'),
(8, 8, 1, 'pwreset-client', '%{company.name} - Acesso ao Help Desk', '<h3><strong>Ol&aacute; %{user.name.first},</strong></h3> <div>Um pedido de redefini&ccedil;&atilde;o de senha foi enviada em seu nome para o help desk em %{url}.<br /><br />Se voc&ecirc; acha que isso foi feito por engano, apague e desconsidere este e-mail. A sua conta esta segura e nenhum e os dados de acesso a ele. Sua conta e sua senha n&atilde;o foram alterados. Algu&eacute;m poderia ter entrado por engano o seu endere&ccedil;o de e-mail.<br /><br />Siga o link abaixo para acessar o help desk e alterar sua senha.<br /><br /><a href="%%7Blink%7D">%{link}</a><br /><br /><br /><em>Seus amigos do suporte&nbsp;%{company.name}<br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="130" height="37" style="width:130px" /></a></em></div>', 'en_US', 'This template defines the email sent to Clients who select the <strong>Forgot My Password</strong> link on the Client Log In page.', '2016-04-28 17:55:58', '2016-04-29 08:22:48'),
(9, 9, 1, 'banner-client', 'Login', 'Por favor, efetue o login para gerenciar e criar novos tickets', 'en_US', 'This composes the header on the Client Log In page. It can be useful to inform your Clients about your log in and registration policies.', '2016-04-28 17:55:58', '2016-04-29 08:21:45'),
(10, 10, 1, 'registration-confirm', 'Criar conta', '<div><strong>Obrigado por se inscrever para uma conta.</strong><br /><br /> Acab&aacute;mos de lhe enviar um e-mail para o endere&ccedil;o informado. Por favor, siga o link no e-mail para confirmar a sua conta e ter acesso aos seus tickets. </div>', 'en_US', 'This templates defines the page shown to Clients after completing the registration form. The template should mention that the system is sending them an email confirmation link and what is the next step in the registration process.', '2016-04-28 17:55:58', '2016-04-29 08:12:52'),
(11, 11, 1, 'registration-thanks', 'Conta Confirmada!', '<div> <strong>Obrigado por se inscrever para uma conta.</strong><br /><br /> Voc&ecirc; confirmou seu endere&ccedil;o de e-mail e ativou sua conta. Voc&ecirc; pode ir e&nbsp;abrir um novo ticket ou gerenciar tickets&nbsp;existentes.<br /><br /><em>Seus amigos do suporte&nbsp;</em>%{company.name}<br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="169" height="48" style="width:169px" /></a></div>', 'en_US', 'This template defines the content displayed after Clients successfully register by confirming their account. This page should inform the user that registration is complete and that the Client can now submit a ticket or access existing tickets.', '2016-04-28 17:55:58', '2016-04-29 08:18:30'),
(12, 12, 1, 'access-link', 'Ticket [#%{ticket.number}] Access Link', '<h3><strong>Hi %{recipient.name.first},</strong></h3> <div> An access link request for ticket #%{ticket.number} has been submitted on your behalf for the helpdesk at %{url}.<br /> <br /> Follow the link below to check the status of the ticket #%{ticket.number}.<br /> <br /> <a href="%{recipient.ticket_link}">%{recipient.ticket_link}</a><br /> <br /> If you <strong>did not</strong> make the request, please delete and disregard this email. Your account is still secure and no one has been given access to the ticket. Someone could have mistakenly entered your email address.<br /> <br /> --<br /> %{company.name} </div>', 'en_US', 'This template defines the notification for Clients that an access link was sent to their email. The ticket number and email address trigger the access link.', '2016-04-28 17:55:58', '2016-04-28 17:55:58');

