  PRIMARY KEY (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=99 ;

--
-- Extraindo dados da tabela `ostau_draft`
--

INSERT INTO `ostau_draft` (`id`, `staff_id`, `namespace`, `body`, `extra`, `created`, `updated`) VALUES
(2, 1, 'page.1', '<h1>Bem-vindo ao Centro de Suporte</h1> A fim de agilizar as solicita&ccedil;&otilde;es de suporte e melhor atend&ecirc;-lo, n&oacute;s utilizamos um sistema de tickets. Cada pedido de suporte &eacute; atribu&iacute;do um n&uacute;mero de tickets &uacute;nico, que voc&ecirc; pode usar para monitorar o progresso e respostas online. Para sua refer&ecirc;ncia, n&oacute;s fornecemos arquivos completos e hist&oacute;rico de todos os seus pedidos de suporte.<br />', NULL, '2016-04-29 11:30:04', NULL),
(4, 1, 'page.3', '<div><h1><span style="font-size:medium">Sistema de Suporte Offline</span> </h1> Por favor desculpe, voltaremos assim que poss&iacute;vel.<br /> O nosso servi&ccedil;o de assist&ecirc;ncia est&aacute; offline no momento, por favor, volte mais tarde.<br /></div>', NULL, '2016-04-29 11:31:22', NULL),
(7, 1, 'page.2', '%{ticket.name}, <br /><br /> Obrigado por nos contatar.<br /><br /> Um pedido de ticket de suporte foi criado e um representante estar&aacute; respondendo&nbsp;de volta para voc&ecirc; em breve, se necess&aacute;rio. <br /><br /><br />Equipe de Suporte<br />', NULL, '2016-04-29 11:56:12', '2016-04-29 11:56:21'),
(22, 1, 'tpl.note.alert.1', '<h3><strong>Ol&aacute; %{recipient.name},</strong></h3> Um agente tem registado atividade no bilhete <a href="%%7Bticket.staff_link%7D">#%{ticket.number}</a> <br /><br /><table><tbody><tr><td> <strong>De</strong>: </td> <td> %{note.poster} </td> </tr><tr><td> <strong>Titulo</strong>: </td> <td> %{note.title} </td> </tr></tbody></table><br /> %{note.message} <br /><br /><hr /> Para visualizar/responder ao ticket, Por favor&nbsp;<a href="%%7Bticket.staff_link%7D">acesse</a> o sistema de ticket.<br /><em>Seus amigos da Equipe de Suporte</em><br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" style="width:226px" width="226" height="64" /></a>', NULL, '2016-04-29 12:21:03', '2016-04-29 12:21:14'),
(26, 1, 'tpl.ticket.activity.notice.1', '<h3><strong>Caro %{recipient.name.first},</strong></h3> <div> <em>%{poster.name}</em> apenas registado uma mensagem para um ticket em que voc&ecirc; participa. </div> <br /> %{message} <br /><br /><hr /><div style="color:rgb(127, 127, 127);font-size:small;text-align:center"> <em>Voc&ecirc; est&aacute; recebendo este e-mail porque voc&ecirc; &eacute; um colaborador de ticket <a href="%%7Brecipient.ticket_link%7D" style="color:rgb(84, 141, 212)">#%{ticket.number}</a>. Para participar, basta responder a este e-mail ou&nbsp;<a href="%%7Brecipient.ticket_link%7D" style="color:rgb(84, 141, 212)">clique aqui</a> para visualizar o ticket completo.</em> </div>', NULL, '2016-04-29 12:25:49', '2016-04-29 13:07:15'),
(43, 1, 'tpl.ticket.overdue.1', '<h3><strong>Ol&aacute; %{recipient.name}</strong>,</h3> O ticket, <a href="%%7Bticket.staff_link%7D">#%{ticket.number}</a> est&aacute; seriamente atrasado.<br /><br /> Devemos todos trabalhar arduamente para garantir que todos os tickets est&atilde;o sendo tratados em tempo h&aacute;bil.<br /><br /> Assinado,<br /> %{ticket.dept.manager.name} <hr /><div>Para ver ou responder ao ticket, por favor&nbsp;<span style="color:rgb(84, 141, 212)"><a href="%%7Bticket.staff_link%7D">a</a>cesse</span>&nbsp;o sistema de ticket de suporte. Voc&ecirc; est&aacute; recebendo este aviso porque o ticket &eacute; atribu&iacute;do diretamente a voc&ecirc; ou a uma equipe ou departamento que voc&ecirc; &eacute; membro.<br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" style="width:186px" width="186" height="53" /></a></div>', NULL, '2016-04-29 13:05:50', '2016-04-29 13:06:39'),
(44, 1, 'tpl.transfer.alert.1', '<h3>Ol&aacute; %{recipient.name},</h3> Ticket <a href="%%7Bticket.staff_link%7D">#%{ticket.number}</a> foi transferido para o %{ticket.dept.name} departamento de&nbsp;<strong>%{staff.name.short}</strong> <br /><br /><blockquote> %{comments} </blockquote> <hr /><div>Para visualizar/responder ao ticket, Por favor <a href="http://tickets.intellissis.com.br/scp/%%7Bticket.staff_link%7D">acesse</a> o sistema de ticket.<br /><em>Seus amigos da Equipe de Suporte</em><br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="222" height="63" style="width:222px" /></a><br /></div>', NULL, '2016-04-29 13:06:13', '2016-04-29 13:06:42'),
(45, 1, 'tpl.assigned.alert.1', '<h3><strong>Ol&aacute; %{assignee.name.first},</strong></h3> Ticket <a href="%%7Bticket.staff_link%7D">#%{ticket.number}</a> foi atribu&iacute;do a voc&ecirc; pelo %{assigner.name.short} <br /><br /><table><tbody><tr><td> <strong>De</strong>: </td> <td> %{ticket.name} &lt;%{ticket.email}&gt; </td> </tr><tr><td> <strong>Assunto</strong>: </td> <td> %{ticket.subject} </td> </tr></tbody></table><br /> %{comments} <br /><br /><hr />Para visualizar/responder ao ticket, Por favor <a href="http://tickets.intellissis.com.br/scp/%%7Bticket.staff_link%7D">acesse</a> o sistema de ticket.<br /><em>Seus amigos da Equipe de Suporte</em><br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="180" height="51" style="width:180px" /></a>', NULL, '2016-04-29 13:06:33', '2016-04-29 13:06:42'),
(47, 1, 'tpl.ticket.autoreply.1', '<h3><strong>Caro %{recipient.name.first},</strong></h3> Um pedido de suporte foi criada e atribu&iacute;da ao ticket <a href="%%7Brecipient.ticket_link%7D">#%{ticket.number}</a> com a seguinte resposta autom&aacute;tica.<br /><br /> T&oacute;pico: <strong>%{ticket.topic.name}</strong> <br /> Assunto: <strong>%{ticket.subject}</strong> <br /><br /> %{response} <br /><br /><div style="color:rgb(127, 127, 127)"><em>Seus amigos da Equipe de Suporte</em> %{company.name},<br /> %{signature}<br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" style="width:159px" width="159" height="45" /></a></div> <hr /><div style="color:rgb(127, 127, 127);font-size:small"><em>Esperamos que esta resposta tenha suficientemente respondido suas perguntas.&nbsp;Se voc&ecirc; deseja fornecer coment&aacute;rios ou informa&ccedil;&otilde;es adicionais, responda a este e-mail ou&nbsp;<a href="%%7Brecipient.ticket_link%7D"><span style="color:rgb(84, 141, 212)">fa&ccedil;a o login na sua conta</span></a> para visualizar&nbsp;seus pedidos de suporte.</em></div>', NULL, '2016-04-29 13:08:13', NULL),
(48, 1, 'tpl.ticket.autoresp.1', '<h3><strong>Caro %{recipient.name.first},</strong></h3> Um pedido de suporte foi criado e atribu&iacute;do ao ticket #%{ticket.number}. Um representante ir&aacute; entrar em contato&nbsp;com voc&ecirc; o mais r&aacute;pido poss&iacute;vel. Voc&ecirc; pode&nbsp;<a href="%%7Brecipient.ticket_link%7D">ver o processo do ticket online</a>. <br /><br /><div style="color:rgb(127, 127, 127)"> <em>Seus amigos da Equipe de Suporte</em> %{company.name}, <br /> %{signature}<br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="148" height="42" style="width:148px" /></a></div><hr /><div style="color:rgb(127, 127, 127);font-size:small"><em>Se voc&ecirc; desejar fornecer coment&aacute;rios adicionais ou informa&ccedil;&otilde;es sobre o assunto, responda a este e-mail ou <a href="%%7Brecipient.ticket_link%7D"><span style="color:rgb(84, 141, 212)">fa&ccedil;a o login na sua conta</span></a> para ter acesso a todos seus pedidos de suporte.</em></div>', NULL, '2016-04-29 13:08:54', NULL),
(49, 1, 'tpl.ticket.overlimit.1', '<h3><strong>Ol&aacute; %{ticket.name.first},</strong></h3> Voc&ecirc; alcan&ccedil;ou o n&uacute;mero m&aacute;ximo de&nbsp;tickets aberto permitidos. Para ser capaz de abrir um outro&nbsp;ticket, um dos seus bilhetes pendentes devem ser fechados. Para atualizar ou adicionar coment&aacute;rios a um&nbsp;ticket em aberto basta <a href="%%7Burl%7D/tickets.php?e=%%7Bticket.email%7D">acessar nosso helpdesk</a>. <br /><br /> Obrigado,<br /><em>Seus amigos da Equipe de Suporte.</em><br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="226" height="64" style="width:226px" /></a>', NULL, '2016-04-29 13:09:27', NULL),
