INSERT INTO `ostau_email_template` (`id`, `tpl_id`, `code_name`, `subject`, `body`, `notes`, `created`, `updated`) VALUES
(1, 1, 'ticket.autoresp', 'Ticket de Suporte Aberto [#%{ticket.number}]', '<h3><strong>Caro %{recipient.name.first},</strong></h3> Um pedido de suporte foi criada e atribu&iacute;da ao ticket #%{ticket.number}. Um representante ir&aacute; entrar em contato&nbsp;com voc&ecirc; o mais r&aacute;pido poss&iacute;vel. Voc&ecirc; pode&nbsp;<a href="%%7Brecipient.ticket_link%7D">ver o processo do ticket online</a>. <br /><br /><div style="color:rgb(127, 127, 127)"> <em>Seus amigos da Equipe de Suporte</em> %{company.name}, <br /> %{signature}<br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="148" height="42" style="width:148px" /></a></div><hr /><div style="color:rgb(127, 127, 127);font-size:small"><em>Se voc&ecirc; desejar fornecer coment&aacute;rios adicionais ou informa&ccedil;&otilde;es sobre o assunto, responda a este e-mail ou <a href="%%7Brecipient.ticket_link%7D"><span style="color:rgb(84, 141, 212)">fa&ccedil;a o login na sua conta</span></a> para ter acesso a todos seus pedidos de suporte.</em></div>', NULL, '2016-04-28 17:55:58', '2016-04-29 10:08:52'),
(2, 1, 'ticket.autoreply', 'Re: %{ticket.subject} [#%{ticket.number}]', '<h3><strong>Caro %{recipient.name.first},</strong></h3> Um pedido de suporte foi criada e atribu&iacute;da ao ticket <a href="%%7Brecipient.ticket_link%7D">#%{ticket.number}</a> com a seguinte resposta autom&aacute;tica.<br /><br /> T&oacute;pico: <strong>%{ticket.topic.name}</strong> <br /> Assunto: <strong>%{ticket.subject}</strong> <br /><br /> %{response} <br /><br /><div style="color:rgb(127, 127, 127)"><em>Seus amigos da Equipe de Suporte</em> %{company.name},<br /> %{signature}<br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" style="width:159px" width="159" height="45" /></a></div> <hr /><div style="color:rgb(127, 127, 127);font-size:small"><em>Esperamos que esta resposta tenha suficientemente respondido suas perguntas.&nbsp;Se voc&ecirc; deseja fornecer coment&aacute;rios ou informa&ccedil;&otilde;es adicionais, responda a este e-mail ou&nbsp;<a href="%%7Brecipient.ticket_link%7D"><span style="color:rgb(84, 141, 212)">fa&ccedil;a o login na sua conta</span></a> para visualizar&nbsp;seus pedidos de suporte.</em></div>', NULL, '2016-04-28 17:55:58', '2016-04-29 10:08:11'),
(3, 1, 'message.autoresp', 'Mensagem de Confirmação', '<h3><strong>Caro %{recipient.name.first},</strong></h3> Sua resposta demanda&nbsp;<a href="%%7Brecipient.ticket_link%7D">#%{ticket.number}</a> foi registrada.<br /><br /><div style="color:rgb(127, 127, 127)"> <em>Seus amigos da Equipe de Suporte</em> %{company.name},<br /> %{signature}<br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="151" height="43" style="width:151px" /></a></div><div style="color:rgb(127, 127, 127);font-size:small;text-align:center"><em>Voc&ecirc; pode ver o&nbsp;processo de pedido de suporte&nbsp;<a href="%%7Brecipient.ticket_link%7D">online aqui</a></em></div>', NULL, '2016-04-28 17:55:58', '2016-04-29 10:07:50'),
(4, 1, 'ticket.notice', '%{ticket.subject} [#%{ticket.number}]', '<h3><strong>Caro %{recipient.name.first},</strong></h3> Nossa equipe de atendimento ao cliente criou o ticket, <a href="%%7Brecipient.ticket_link%7D">#%{ticket.number}</a> em seu nome, com os seguintes detalhes e resumo:<br /><br /> T&oacute;pico: <strong>%{ticket.topic.name}</strong> <br /> Assunto: <strong>%{ticket.subject}</strong> <br /><br /> %{message} <br /><br /> Se necess&aacute;rio, um representante ir&aacute; entrar em contato com voc&ecirc; o mais r&aacute;pido poss&iacute;vel. Voc&ecirc; tamb&eacute;m pode&nbsp; <a href="%%7Brecipient.ticket_link%7D">ver o processo do ticket&nbsp;online</a>. <br /><br /><div style="color:rgb(127, 127, 127)"> <em>Seus amigos da Equipe de Suporte</em> %{company.name},<br /> %{signature}<br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" style="width:162px" width="162" height="46" /></a></div> <hr /><div style="color:rgb(127, 127, 127);font-size:small"><em>Se voc&ecirc; desejar fornecer coment&aacute;rios ou informa&ccedil;&otilde;es suplementares sobre a quest&atilde;o, responda a este e-mail ou <a href="%%7Brecipient.ticket_link%7D"><span style="color:rgb(84, 141, 212)">acesse sua conta</span></a> <em>para ter acesso a todos seus pedidos de suporte.</em></em></div>', NULL, '2016-04-28 17:55:58', '2016-04-29 10:09:16'),
(5, 1, 'ticket.overlimit', 'Limite de Tickets Abertos', '<h3><strong>Ol&aacute; %{ticket.name.first},</strong></h3> Voc&ecirc; alcan&ccedil;ou o n&uacute;mero m&aacute;ximo de&nbsp;tickets aberto permitidos. Para ser capaz de abrir um outro&nbsp;ticket, um dos seus bilhetes pendentes devem ser fechados. Para atualizar ou adicionar coment&aacute;rios a um&nbsp;ticket em aberto basta <a href="%%7Burl%7D/tickets.php?e=%%7Bticket.email%7D">acessar nosso helpdesk</a>. <br /><br /> Obrigado,<br /><em>Seus amigos da Equipe de Suporte.</em><br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="226" height="64" style="width:226px" /></a>', NULL, '2016-04-28 17:55:58', '2016-04-29 10:09:24'),
(6, 1, 'ticket.reply', 'Re: %{ticket.subject} [#%{ticket.number}]', '<h3><strong>Caro %{recipient.name},</strong></h3> %{response} <br /><br /><div style="color:rgb(127, 127, 127)"> <em>Seus amigos da Equipe de Suporte</em> %{company.name},<br /> %{signature}<br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" style="width:169px" width="169" height="48" /></a></div> <hr /><div style="color:rgb(127, 127, 127);font-size:small;text-align:center"><em>Esperamos que esta resposta tem suficientemente respondido suas perguntas.&nbsp;Se n&atilde;o, por favor, n&atilde;o enviar outro e-mail. Em vez disso, responda a este e-mail ou <a href="%%7Brecipient.ticket_link%7D" style="color:rgb(84, 141, 212)">fa&ccedil;a o login na sua conta</a> para ter acesso completo a todos os seus pedidos de suporte&nbsp;e respostas.</em></div>', NULL, '2016-04-28 17:55:58', '2016-04-29 10:09:42'),
(7, 1, 'ticket.activity.notice', 'Re: %{ticket.subject} [#%{ticket.number}]', '<h3><strong>Caro %{recipient.name.first},</strong></h3> <div> <em>%{poster.name}</em> apenas registado uma mensagem para um ticket em que voc&ecirc; participa. </div> <br /> %{message} <br /><br /><hr /><div style="color:rgb(127, 127, 127);font-size:small;text-align:center"> <em>Voc&ecirc; est&aacute; recebendo este e-mail porque voc&ecirc; &eacute; um colaborador de ticket <a href="%%7Brecipient.ticket_link%7D" style="color:rgb(84, 141, 212)">#%{ticket.number}</a>. Para participar, basta responder a este e-mail ou&nbsp;<a href="%%7Brecipient.ticket_link%7D" style="color:rgb(84, 141, 212)">clique aqui</a> para visualizar o ticket completo.</em> </div>', NULL, '2016-04-28 17:55:58', '2016-04-29 09:25:47'),
(8, 1, 'ticket.alert', 'Alerta de Novo Ticket', '<h2>Ol&aacute; %{recipient.name},</h2>Novo ticket #%{ticket.number} criado.&nbsp;<br /><br /><table><tbody><tr><td> <strong>De</strong>: </td> <td> %{ticket.name} &lt;%{ticket.email}&gt; </td> </tr><tr><td><strong>Departamento</strong>: </td> <td> %{ticket.dept.name} </td> </tr></tbody></table><br /> %{message} <br /><br /><hr /><div>Para visualizar/responder ao ticket, Por favor <a href="http://tickets.intellissis.com.br/scp/%%7Bticket.staff_link%7D">acesse</a> o sistema de ticket.<br /><em>Seus amigos da Equipe de Suporte</em><br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="201" height="57" style="width:201px" /></a><br /></div>', NULL, '2016-04-28 17:55:58', '2016-04-29 10:06:43'),
(9, 1, 'message.alert', 'Alerta de Nova Mensagem', '<h3><strong>Ol&aacute; %{recipient.name},</strong></h3> Nova mensagem anexada ao ticket <a href="%%7Bticket.staff_link%7D">#%{ticket.number}</a> <br /><br /><table><tbody><tr><td> <strong>De</strong>: </td> <td> %{ticket.name} &lt;%{ticket.email}&gt; </td> </tr><tr><td> <strong>Departamento</strong>: </td> <td> %{ticket.dept.name} </td> </tr></tbody></table><br /> %{message} <br /><br /><hr />Para visualizar/responder ao ticket, Por favor <a href="http://tickets.intellissis.com.br/scp/%%7Bticket.staff_link%7D">acesse</a> o sistema de ticket.<br /><br /><em>Seus amigos da Equipe de Suporte</em><br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="201" height="57" style="width:201px" /></a>', NULL, '2016-04-28 17:55:58', '2016-04-29 10:06:35'),
(10, 1, 'note.alert', 'Aleta de Nova Atividade Interna', '<h3><strong>Ol&aacute; %{recipient.name},</strong></h3> Um agente tem registado atividade no bilhete <a href="%%7Bticket.staff_link%7D">#%{ticket.number}</a> <br /><br /><table><tbody><tr><td> <strong>De</strong>: </td> <td> %{note.poster} </td> </tr><tr><td> <strong>Titulo</strong>: </td> <td> %{note.title} </td> </tr></tbody></table><br /> %{note.message} <br /><br /><hr /> Para visualizar/responder ao ticket, Por favor&nbsp;<a href="%%7Bticket.staff_link%7D">acesse</a> o sistema de ticket.<br /><em>Seus amigos da Equipe de Suporte</em><br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" style="width:226px" width="226" height="64" /></a>', NULL, '2016-04-28 17:55:58', '2016-04-29 09:21:01'),
(11, 1, 'assigned.alert', 'Ticket atribuído a você', '<h3><strong>Ol&aacute; %{assignee.name.first},</strong></h3> Ticket <a href="%%7Bticket.staff_link%7D">#%{ticket.number}</a> foi atribu&iacute;do a voc&ecirc; pelo %{assigner.name.short} <br /><br /><table><tbody><tr><td> <strong>De</strong>: </td> <td> %{ticket.name} &lt;%{ticket.email}&gt; </td> </tr><tr><td> <strong>Assunto</strong>: </td> <td> %{ticket.subject} </td> </tr></tbody></table><br /> %{comments} <br /><br /><hr />Para visualizar/responder ao ticket, Por favor <a href="http://tickets.intellissis.com.br/scp/%%7Bticket.staff_link%7D">acesse</a> o sistema de ticket.<br /><em>Seus amigos da Equipe de Suporte</em><br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="180" height="51" style="width:180px" /></a>', NULL, '2016-04-28 17:55:58', '2016-04-29 10:05:58'),
(12, 1, 'transfer.alert', 'Ticket #%{ticket.number} transferido - %{ticket.dept.name}', '<h3>Ol&aacute; %{recipient.name},</h3> Ticket <a href="%%7Bticket.staff_link%7D">#%{ticket.number}</a> foi transferido para o %{ticket.dept.name} departamento de&nbsp;<strong>%{staff.name.short}</strong> <br /><br /><blockquote> %{comments} </blockquote> <hr /><div>Para visualizar/responder ao ticket, Por favor <a href="http://tickets.intellissis.com.br/scp/%%7Bticket.staff_link%7D">acesse</a> o sistema de ticket.<br /><em>Seus amigos da Equipe de Suporte</em><br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" width="222" height="63" style="width:222px" /></a><br /></div>', NULL, '2016-04-28 17:55:58', '2016-04-29 10:06:10'),
(13, 1, 'ticket.overdue', 'Alerta Ticket Atrasado', '<h3><strong>Ol&aacute; %{recipient.name}</strong>,</h3> O ticket, <a href="%%7Bticket.staff_link%7D">#%{ticket.number}</a> est&aacute; seriamente atrasado.<br /><br /> Devemos todos trabalhar arduamente para garantir que todos os tickets est&atilde;o sendo tratados em tempo h&aacute;bil.<br /><br /> Assinado,<br /> %{ticket.dept.manager.name} <hr /><div>Para ver ou responder ao ticket, por favor&nbsp;<span style="color:rgb(84, 141, 212)"><a href="%%7Bticket.staff_link%7D">a</a>cesse</span>&nbsp;o sistema de ticket de suporte. Voc&ecirc; est&aacute; recebendo este aviso porque o ticket &eacute; atribu&iacute;do diretamente a voc&ecirc; ou a uma equipe ou departamento que voc&ecirc; &eacute; membro.<br /><a href="http://intellissis.com.br/" target="_blank"><img src="cid:yticfqhzkfuk4-c7-dj2ehsmsgvk_9c4" alt="Intellissis - Sistemas Inteligentes" style="width:186px" width="186" height="53" /></a></div>', NULL, '2016-04-28 17:55:58', '2016-04-29 10:05:47');

